  var scrollFunction = function() {
    // window.addEventListener("scroll", () => {
      var header = document.querySelector("header")
      header.classList.toggle("sticky", window)
    // })
  }
  return (
    <div className="App" onScrollCapture={scrollFunction}>
      <header className="header">
        <label className="header-logo">Portfolio</label>
        <ul>
          <li>Home</li>
          <li>Contact</li>
          <li>Skills</li>
          <li>Experience</li>
        </ul>
      </header>
    </div>
  );
}

export default App;
